import React, { Component } from 'react';
import SubMain from './SubMain'

class Main extends Component {
    state = { 
        persons: [
            {name:'John', age:26},
            {name:'Habib', age:25},
            {name:'Tonoy', age:22}
        ]
     }
    render() { 
        return ( 
           <div>
               {
                   this.state.persons.map(item =>{
                   <div>{item.name}</div>
                   })
               }
              <SubMain name={this.state.persons[0].name} />
           </div> 
         );
    }
}

export default Main;
